toscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"655068","type":"CustomJS"},{"attributes":{"data":{"x":[44,1258]},"selected":{"id":"654868"},"selection_policy":{"id":"654867"}},"id":"654844","type":"ColumnDataSource"},{"attributes":{},"id":"654942","type":"RedoTool"},{"attributes":{"source":{"id":"654844"}},"id":"654849","type":"CDSView"},{"attributes":{"data":{"Close":{"__ndarray__":"uB6F61G4TEBxPQrXo5BMQHsUrkfhekxAmpmZmZkZTEDhehSuRwFMQArXo3A9qktA4XoUrkfBS0CuR+F6FC5MQFK4HoXrcUxASOF6FK5HTEDNzMzMzGxMQMP1KFyPIkxAcT0K16NQTECamZmZmZlMQHsUrkfhmkxAj8L1KFzvTEDNzMzMzExNQI/C9ShcT01ACtejcD0qTUBxPQrXozBNQB+F61G4Xk1AMzMzMzNzTUCF61G4HkVNQBSuR+F6dExAXI/C9SgcTEDsUbgehStMQI/C9Shcb0xA7FG4HoVLTED2KFyPwjVMQLgehetR+EtA7FG4HoXrS0DhehSuRyFMQOxRuB6FK0xAmpmZmZlZTEBSuB6F6/FMQKRwPQrXY01Aj8L1KFxvTUAK16NwPWpNQFK4HoXrsU1AuB6F61GYTUCuR+F6FA5NQD0K16Nw/UxAFK5H4Xq0TEApXI/C9UhMQDMzMzMzc0xAuB6F61FYTEAAAAAAAOBLQEjhehSuB0xA4XoUrkfhS0CPwvUoXC9MQFyPwvUofExAUrgehevRTECkcD0K1yNNQEjhehSuJ01A4XoUrkdBTUDXo3A9CldNQDMzMzMz001AuB6F61H4TUAfhetRuD5OQOxRuB6Fa05AzczMzMxsTkBcj8L1KJxOQD0K16NwnU5AZmZmZmbGTkCkcD0K1wNPQFyPwvUo/E1AAAAAAABATkBxPQrXo7BOQI/C9Shcr05AUrgeheuxTkDsUbgehatOQMP1KFyPok5AKVyPwvWITkB7FK5H4dpOQOxRuB6Fq05A16NwPQp3TkAAAAAAAIBOQK5H4XoUrk5AMzMzMzMTT0C4HoXrUfhOQPYoXI/CtU5AS
